import React, { useState } from "react";
import axios from "axios";

const Dashboard = ({ token }) => {
  const [query, setQuery] = useState("");
  const [responses, setResponses] = useState([]);

  const handleSearch = async () => {
    const { data } = await axios.get(`http://127.0.0.1:8000/api/interview/search-responses/?query=${query}`);
    setResponses(data.similar_responses);
  };

  if (!token) {
    return <h2>Please login to access the dashboard</h2>;
  }

  return (
    <div>
      <h2>AI Interview Dashboard</h2>
      <input type="text" value={query} onChange={(e) => setQuery(e.target.value)} placeholder="Search responses" />
      <button onClick={handleSearch}>Search</button>

      <h3>Similar Responses</h3>
      <ul>
        {responses.map((res, index) => (
          <li key={index}>{res}</li>
        ))}
      </ul>
    </div>
  );
};

export default Dashboard;
